CustomCss:
:root {
  --mud-typography-default-family: Sans-serif !important;
  --mud-typography-h1-family: "DM Sans", Sans-serif !important;
  --mud-typography-h2-family: "DM Sans", Sans-serif !important;
  --mud-typography-h3-family: "DM Sans", Sans-serif !important;
  --mud-typography-h4-family: "DM Sans", Sans-serif !important;
  --mud-typography-h5-family: "DM Sans", Sans-serif !important;
  --mud-typography-body1-family: Inter, sans-serif !important;
  --mud-typography-body2-family: Inter, sans-serif !important;
  --mud-typography-subtitle1-family: "DM Sans", Sans-serif !important;
  --mud-typography-button-family: Inter, sans-serif !important;
  --mud-default-borderradius: 15px;
  --mud-typography-button-size: 14px;
}

.mud-table,
.mud-paper,
.mud-tabs,
.mud-elevation,
.mud-expand-panel
{
   border: 2px solid #f2f2f2;
   box-shadow: none;
}

.mud-expand-panel:last-child {
   border-bottom: 2px solid #f2f2f2! important;
}

.mud-button {
    border-radius: 45px;
    padding: 10px;
    box-shadow: none;
    text-transform: none;
}

.mud-button-label {
    margin-left: 10px;
    margin-right: 10px;
}

.mud-appbar {
    border-bottom: 2px solid #f2f2f2;
    box-shadow: none;
}

.mud-drawer {
    border-top: 2px solid #f2f2f2;
    border-right: 2px solid #f2f2f2;
    box-shadow: none;
}
